import { Vue, Component, Prop } from 'vue-property-decorator';
@Component
export default class RkRadio extends Vue {
  @Prop() public data!: any;
  @Prop() public current!: any;

  private changeOpt(item: any) {
    this.$emit('onChoose', item);
  }
}
